import React from 'react';

function Player({ number, score, wins, isActive }) {
  return (
    <div className={`player ${isActive ? 'active' : ''}`}>
      <h2>Player {number}</h2>
      <p>Score: {score}</p>
      <p>Wins: {wins}</p>
    </div>
  );
}

export default Player;
